import { Component, OnInit, Input, Output, EventEmitter } from '@angular/core';
import { Router } from '@angular/router';
import { LeaderboardInfo } from '../types';

@Component({
  selector: 'app-leaderboard-data-page',
  templateUrl: './leaderboard-data-page.component.html',
  styleUrls: ['./leaderboard-data-page.component.css']
})
export class LeaderboardDataPageComponent implements OnInit{
  @Input() buttonText: any;
  @Input() currentGameID = 0;
  @Input() currentTimePlayed = 0;
  @Input() currentKDR = 0;
  @Input() currentWLR = 0;
  @Input() currentRank = '';

  gameID: number = 0;
  timePlayed: number = 0;
  kdR: number = 0;
  wlR: number = 0;
  playerRank: string = '';

  @Output() onSubmit = new EventEmitter<LeaderboardInfo>();

  constructor(
    private router: Router,
  ) { }

  ngOnInit(): void {
    this.firstName = this.currentFName;
    this.lastName = this.currentLName;
    this.gamertag = this.currentGamertag;
    this.platform = this.currentPlatform;
    this.age = this.currentAge;
    this.regionID = this.currentRegion;
  }

  onButtonClicked(): void {
    this.onSubmit.emit({
      playerID: 0,
      firstName: this.firstName,
      lastName: this.lastName,
      gamertag: this.gamertag,
      platform: this.platform,
      age: this.age,
      teamID: 0,
      regionID: this.regionID,
    });
  }
}
